import React, { Component } from 'react';

class CarrosselProjetos extends Component {
  render() {
    return (
    <div className = "row">
		<div className = "col">			
			<b>Meus Projetos:</b>
			<div>
				<div id="carouselExampleSlidesOnly" class="carousel slide" data-ride="carousel">
				  <div class="carousel-inner">
					<div class="carousel-item active">
					  <img class="d-block w-100" src="produto1.jpg" alt="First slide"/>
					</div>
					<div class="carousel-item">
					  <img class="d-block w-100" src="produto2.jpg" alt="Second slide"/>
					</div>
					<div class="carousel-item">
					  <img class="d-block w-100" src="produto3.jpg" alt="Third slide"/>
					</div>
				  </div>
				</div>
			</div>
		</div>
	</div>
    );
  }
}

export default CarrosselProjetos;
